import React, { Component } from "react";
import ItemBox from "../ItemBox/ItemBox";

import "./BoxInfosEvento.css";
import imagemEvento1 from '../../assets/images/criareventos/img/fotoEvento1.png';
import imagemEvento2 from '../../assets/images/criareventos/img/fut1.png';
import imagemEvento3 from '../../assets/images/criareventos/img/fut2.png';
import imagemEvento4 from '../../assets/images/criareventos/img/conserto.png';
import imagemEvento5 from '../../assets/images/criareventos/img/so-alegria.png';

function BoxInfosEvento(props) {

  function atualizarEventosProximos() {

    let params = {
      latitute: -23.5791213,
      longitute: -46.6658027
    }
    axios.post("http://localhost:8080/evento/atualizareventos-proximos", params).then(function (resultadoAtualizacaoEvento) {
      console.log(resultadoAtualizacaoEvento.data.length);
      for (let i = 0; i < resultadoAtualizacaoEvento.data.length; i++) {
        locations[i] = new Array(resultadoAtualizacaoEvento.data.length)
        for (let j = 0; j < locations.length; j++) {
          locations[i][0] = resultadoAtualizacaoEvento.data[i][0]
          locations[i][1] = resultadoAtualizacaoEvento.data[i][3]
          locations[i][2] = resultadoAtualizacaoEvento.data[i][4]
          document.getElementById(`evento${i + 1}`).innerHTML = resultadoAtualizacaoEvento.data[i][0];

        }
      }
      console.log("Está funcionando a atualização de eventos")
    }).catch(e => {
      console.log(e);
    })

    return locations

  }
    return (
        <>
    <aside className="boxinfos">
      <ul className="boxinfos-items">
        <li className="boxinfos-titulo">
          <p>
            {props.titulo}            
          </p>
        </li>
      </ul>
      <ItemBox image={imagemEvento1} nome=""/>
      <ItemBox image={imagemEvento2} nome="Futebolzinho"/>
      <ItemBox image={imagemEvento3} nome="Bandfut"/>
      <ItemBox image={imagemEvento4} nome="Conserto legal"/>
      <ItemBox image={imagemEvento5} nome="So alegria"/>
    </aside>
    </>
    );  
}

export default BoxInfosEvento;
